import React from 'react';
import menuImage from './images/logo1.png';
import happyHourImage from './images/img2.png';
import locationImage from './images/img1.png';
import dessertImage from './images/img3.png';
import drinksImage from './images/img1.png';
import snacksImage from './images/img2.png';
import seafoodImage from './images/img1.png';
import bakeryImage from './images/img2.png';
import Footer from './Footer';

const HomePage = () => {
  const styles = {
    homePage: {
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      backgroundColor: '#f5e5d6', // Background color for the page
    },
    heroSection: {
      height: '30vh',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      width: '100%',
      margin: 0,
      padding: 0,
    },
    heroOverlay: {
      color: '#ffffff',
      fontSize: '3rem',
      textAlign: 'center',
      fontFamily: "'Dancing Script', cursive",
      letterSpacing: '1px',
      textShadow: '2px 2px 8px rgba(0, 0, 0, 0.8)',
    },
    circlesSection: {
      display: 'flex',
      justifyContent: 'center',
      gap: '20px',
      marginTop: '20px',
    },
    circleItem: {
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      cursor: 'pointer',
    },
    circleImage: {
      width: '75px',
      height: '75px',
      borderRadius: '50%',
      objectFit: 'cover',
      padding: '3px',
      background: 'linear-gradient(45deg, #8D6E63, #D4AF37, #d9b8a6)',
      border: '4px solid transparent',
    },
    circleLabel: {
      marginTop: '8px',
      fontSize: '0.9rem',
      color: '#333',
    },
    gridSection: {
      display: 'grid',
      gridTemplateColumns: 'repeat(3, 1fr)',
      gap: '20px',
      padding: '20px',
      maxWidth: '1000px',
    },
    gridItem: {
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      textAlign: 'center',
      backgroundColor: '#fff',
      padding: '10px',
      width: '200px',
      height: '200px',
      borderRadius: '10px',
      boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
      transition: 'transform 0.3s ease-in-out',
    },
    gridItemHover: {
      transform: 'scale(1.05)',
    },
    gridImage: {
      width: '100%',
      height: '100px',
      objectFit: 'cover',
      borderRadius: '10px',
    },
    gridHeading: {
      marginTop: '10px',
      fontSize: '1rem',
      fontWeight: 'bold',
      color: '#333',
    },
  };

  return (
    <div style={styles.homePage}>
      <div style={styles.heroSection}>
        <div style={styles.heroOverlay}>
          <h1>CulinarEAT</h1>
        </div>
      </div>

      <div style={styles.circlesSection}>
        {[
          { src: menuImage, label: 'About Us' },
          { src: happyHourImage, label: 'Cooking Tips' },
          { src: locationImage, label: 'Baking Tips' },
          { src: dessertImage, label: 'Conversions' },
        ].map((item, index) => (
          <div style={styles.circleItem} key={index}>
            <img src={item.src} alt={item.label} style={styles.circleImage} />
            <span style={styles.circleLabel}>{item.label}</span>
          </div>
        ))}
      </div>

      <div style={styles.gridSection}>
        {[
          { src: menuImage, label: 'Menu' },
          { src: happyHourImage, label: 'Happy Hour' },
          { src: locationImage, label: 'Location' },
          { src: dessertImage, label: 'Desserts' },
          { src: drinksImage, label: 'Drinks' },
          { src: snacksImage, label: 'Snacks' },
          { src: seafoodImage, label: 'Seafood' },
          { src: bakeryImage, label: 'Bakery' },
        ].map((item, index) => (
          <div
            key={index}
            style={styles.gridItem}
            onMouseOver={(e) => (e.currentTarget.style.transform = 'scale(1.05)')}
            onMouseOut={(e) => (e.currentTarget.style.transform = 'scale(1)')}
          >
            <img src={item.src} alt={item.label} style={styles.gridImage} />
            <h2 style={styles.gridHeading}>{item.label}</h2>
          </div>
        ))}
      </div>

      <Footer />
    </div>
  );
};

export default HomePage;
